const Post = ({ post }) => {

  return (
    <div>
      <h3>Leader: {post.leader}</h3>
      <div>singer 1: {post.singer1}</div>
      <div>singer 2: {post.singer2}</div>
      <div>keyboard: {post.keyboard}</div>
      <div>electric: {post.electric}</div>
      <div>acoustic: {post.acoustic}</div>
      <div>bass: {post.bass}</div>
      <div>drummer: {post.drummer}</div>
    </div>
  );
};

export default Post;
